import styled from "styled-components";

export const ContactContainer = styled.div`
    position: relative;
    height: 100%;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`;

export const Title = styled.div`
    padding: 20px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-weight: 500;
    font-style: italic;
    font-size: 36px;
    font-weight: 700;
    letter-spacing: 1.5px;
    line-height: 1rem;
    text-transform: capitalize;
    color: #f9d342;
    flex-grow: 1;
`;

export const ContactContent = styled.div`
    padding: 20px;
    margin-top: 20px;
`;


